const Header = () => {
  return (
    <div>
      <div className="navbar navbar-expand-lg bg-light navbar-light">
        <div className="container-fluid">
        <a href="index.html" class="navbar-brand">Burger <span>King</span></a>
        </div>
      </div>
    </div>
  );
}


export default Header;
